import React, { useState } from "react";

function TestPage() {
  const data = [{ goal: "First value" }];
  let someVar = "x";

  const [value, setValue] = useState(data[0].goal);

  function change() {
    setValue("Second value");
  }

  return <button onClick={change}>{data[0].goal}</button>;
}

export default TestPage;
